import * as React from 'react';
import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import {AppBar} from "@mui/material";
import {Button} from "@mui/material";
import {Toolbar} from "@mui/material";
import {IconButton} from "@mui/material";
import {Typography} from "@mui/material";

import example from '../example.json'

import './Main.css';

const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));

function NavBar(){
    return(
        <Box sx={{ flexGrow: 1 }}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2 }}
                    >
                    </IconButton>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                        News Keywords
                    </Typography>
                </Toolbar>
            </AppBar>
        </Box>
    );
}

function GridComponent(props) {
    const { keywords, news } = props;
    return (
        <Grid item xs={4}>
            <Item>
                {keywords}
                <Box sx={{ height: '200px', padding: '10px'}}/>
            </Item>
        </Grid>
    )
}

function getStaticProps(){
    // const res = await fetch('http://localhost:3000/api/news')
    // const data: JSON = await res.json()
    const data =  JSON.parse(JSON.stringify(example));
    return {
        props:{
            newsData: Object.entries(data)
        }
    }
}

export default async function KeywordGrid() {
    const data = await getStaticProps();
    console.log(data);
    return (
        <>
            <NavBar/>
            <Box sx={{ padding: '30px' }}>
                <Grid container rowSpacing={3} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
                    {data.map(([keywords, news]) =>
                        <GridComponent keywords={keywords} news={news}/>
                    )}
                </Grid>
            </Box>
        </>
    );
}
